import React from 'react';
import './App.css';
import { BrowserRouter, Route } from 'react-router-dom';

function App() {
  return (
    // <BrowserRouter>
      <div className="App">
        <header>
        </header>
          <main>
            <h3>ユーザーを選択してください</h3>
            <Route path="/">
              <Home />
            </Route>
          </main>
      </div>
    // </BrowserRouter>
  );
}

function Home() {
  return <h2>Home</h2>;
}

export default App;
